import React, { Component } from "react";
import Imgbg from "../images/bgimage.png";

class Main extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <img src={Imgbg} />
        </div>
      </div>
    );
  }
}

export default Main;
